import { Outlet } from "react-router-dom";
import React from "react";
import useAuth from "./hooks/useAuth";

const Layout = () => {
  const { auth } = useAuth();
  console.log("LAYOUT AUTH: ", auth);
  return (
    <main className="App">
      {auth !== {} ? <h1>SIEMANO</h1> : <></>}

      <Outlet />
    </main>
  );
};

export default Layout;
